CREATE DEFINER=`root`@`localhost` FUNCTION `GenerateCoffeeID` () RETURNS VARCHAR(255) CHARSET utf8mb4 COLLATE utf8mb4_general_ci DETERMINISTIC BEGIN
    DECLARE newCoffeeID VARCHAR(255);
    DECLARE maxSuffix INT DEFAULT 0;
    DECLARE suffixStr VARCHAR(10);

    SELECT MAX(CAST(SUBSTRING(id, 10) AS UNSIGNED))
    INTO maxSuffix
    FROM coffees
    WHERE YEAR(CURDATE()) = YEAR(CURDATE());

    SET maxSuffix = IFNULL(maxSuffix, 0) + 1;

    SET suffixStr = LPAD(maxSuffix, 4, '0');

    SET newCoffeeID = CONCAT('COF-', YEAR(CURDATE()), '-', suffixStr);

    RETURN newCoffeeID;
END$$

